          "id": "4f21f7c8e6701f5da5a43ff6b21b7f8a5f193b2e",
          "message": "perf: optimize BytecodeReadRafSumcheck init phase (#1190)\n\n* Optimize ReadRafSumcheck init phase\n\n- Add split-eq optimization: pre-compute E_prefix and E_suffix tables once,\n  use lookups instead of calling evals_serial per chunk\n- Replace pc: Vec<usize> with on-the-fly PC computation from trace\n- Use .fold() instead of .map() to reuse allocations within threads\n- Move compute_round_poly to split_eq_poly.rs as gruen_poly_from_evals\n- Fuse all val polynomial computations into single pass (compute_val_polys)\n- Drop unused data after log_K rounds to reduce memory footprint\n\n* Use Arc<BytecodePreprocessing> to avoid cloning bytecode\n\n- Change JoltSharedPreprocessing.bytecode to Arc<BytecodePreprocessing>\n- Implement custom CanonicalSerialize/CanonicalDeserialize for JoltSharedPreprocessing\n- Update RLCStreamingData to use Arc<BytecodePreprocessing>\n- Update all access sites in prover.rs to use Arc::clone\n\n* fmt\n\n* Rename ReadRafSumcheck types to BytecodeReadRaf and InstructionReadRaf prefixes\n\nClarifies distinction between bytecode and instruction lookup sumchecks:\n- BytecodeReadRafSumcheckProver/Verifier/Params in bytecode/read_raf_checking.rs\n- InstructionReadRafSumcheckProver/Verifier/Params in instruction_lookups/read_raf_checking.rs\n\n* fmt\n\n* Fix typo: InstructionInstructionReadRafSumcheckProver -> InstructionReadRafSumcheckProver\n\n* Simplify BytecodeReadRafSumcheckProver::initialize\n\nRemove FixedBitSet sparse tracking and unreduced accumulator overhead.\nUse simpler inline multiplication pattern matching ram_ra.rs.\nThis should fix the 84% regression in initialize time.\n\n* Use double summation pattern for F computation\n\nFactor out E_hi multiplication to outer loop:\n  F[k] = _{c_hi} E_hi[c_hi]  ( _{c_lo : PC(c)=k} E_lo[c_lo] )\n\nInner loop: additions only (cheap)\nOuter loop: one mult per touched PC per c_hi block (sparse)\n\nReduces multiplications from O(T  N_STAGES) to O(touched  out_len  N_STAGES)\n\n* fmt",
