          "message": "docs(bytecode): fix read_raf_checking docstring mismatches (#1199)\n\n* docs(bytecode): fix read_raf_checking docstring mismatches\n\n- Correct degree claim: d+1 (not always cubic/degree-3)\n- Distinguish  (stage-folding) from _s (per-stage Val encoding)\n- Fix binding order: lowhigh (not highlow)\n- Clarify k=bytecode index vs unexpanded_pc(k)=instr.address\n- Document RAF uses VirtualPolynomial::PC, not UnexpandedPC\n- Explain Stage3 RAF offset trick (^4 inside, ^2 outside  ^6)\n\n* fix(bytecode): fix clippy doc_lazy_continuation warning",
