          "id": "0976f993f312022aa6e2c664b330ebd19b66e2e7",
          "message": "pref: optimize booleanity phase-2 with single-gamma batching (#1195)\n\n* Optimize booleanity phase-2 with single-gamma batching\n\nUse ^(2i) as batching coefficients and pre-scale eq tables by ^i,\nreducing per-term field multiplications in the phase-2 hot loop.\n\nKey changes:\n- Sample a single transcript challenge  instead of N independent gammas\n- Derive weights as ^(2i) and pre-scale tables by ^i (so ^i * ^i = ^(2i))\n- SharedRaPolynomials now stores per-poly tables instead of a single shared table\n- Unscale cached openings by ^(-i) at the end\n\nThis eliminates the gamma multiplication from the inner loop, replacing it\nwith pre-computation at the phase-1phase-2 transition.\n\n* refactor: move prover-only gamma_powers to prover state\n\n- BooleanitySumcheckParams now only stores gamma and gamma_powers_square (verifier-minimal)\n- gamma_powers and gamma_powers_inv moved to BooleanitySumcheckProver struct\n- Inline helper functions for clarity",
